Data dari WHO tahun 2015, menunjukkan sekitar 1,13 Miliar orang di dunia terkena hipertensi, artinya 1 dari 3 orang di dunia mempunyai penyakit hipertensi. Diperkirakan pada tahun 2025 akan ada 1,5 Miliar orang yang terkena hipertensi, dan setiap tahunnya Â bakal ada 9,4 juta orang meninggal akibat hipertensi dan komplikasinya.

Diketahui perkiraan jumlah kasus Hipertensi di Indonesia adalah 34,1%, TETAPI hanya 8,8% yang terdiagnosis Hipertensi. Artinya, 91,2% penderita Hipertensi tidak mengetahui dirinya terkena hipertensi. Pasien yang tidak minum obat rutin sebesar 32,3%.

DataÂ dari Kemenkes, bahwa Alasan penderita hipertensi tidak minum obat antara lain karena:

Â°Penderita hipertensi merasa sehat (59,8%),
Â°Kunjungan tidak teratur ke fasyankes (31,3%),
Â°Minum obat tradisional (14,5%),Â°Menggunakan terapi lain (12,5%),
Â°Lupa minum obat (11,5%),
Â°Tidak mampu beli obat (8,1%),Â°Terdapat efek samping obat (4,5%), dan
Â°Obat hipertensi tidak tersedia di Fasyankes (2%).

Sekali lagi, Hipertensi disebut sebagai â€œthe silent killerâ€ karena sering tanpa keluhan. Penderita tidak mengetahui dirinya menyandang hipertensi dan baru diketahui setelah terjadi komplikasi. Karena itu PENTING SEKALI untuk periksa tekanan darah secara berkala.

INGAT: Hipertensi adalah pembunuh nomor 1 di dunia.

Ayo ikuti postingan Medity Indonesia lebih lanjut untuk cari tahu cara menghindari dan mengobati Hipertensi dengan benar.

